export const ProjectCard = ({ title, description,projectUrl, imgUrl }) => {
  return (
    <Col size={12} sm={6} md={4}>

      <div className="proj-imgbx">
        <img src={imgUrl} />
        <div className="proj-txtx">
          <h4>{title}</h4>
          <span>{description}</span>
          {isProjectLive && <a href={projectUrl}> View Project</a>}
        </div>
      </div>
    </Col>
  )
}
